import React from "react";

import "./style.css";

const Header = () => {
  return (
    <div className="not-container">
      <h1>Making it right.</h1>
      <h2>
        We design, develop, and deliver experiences that are technically
        impressive and easy to use.
      </h2>
    </div>
  );
};

export default Header;
